INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, 0.0, 0.0, 0, 0.0, "2020/04/30 12:00:00", "あたしだって\nやるときはやるよ！", 1, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24001);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, 0.0, 0.0, 1, 0.0, "2020/04/30 12:00:00", "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24002);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, 0.0, 0.0, 2, 0.0, "2020/04/30 12:00:00", "終わった終わった\n一人でもなんとか\nなるもんだね", 1, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24003);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (2, 0.0, 0.0, 3, 0.0, "2020/04/30 12:00:00", "やったね！\nこれでようやく\nサボれるよ…", 2, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24004);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (1, 0.0, 0.0, 4, 0.0, "2020/04/30 12:00:00", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 1, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24005);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (2, 0.0, 0.0, 5, 0.0, "2020/04/30 12:00:00", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 2, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24006);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (2, 0.0, 0.0, 6, 0.0, "2020/04/30 12:00:00", "あたしも意外と\nやるもんでしょ？", 2, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24007);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, 0.0, 0.0, 7, 0.0, "2020/04/30 12:00:00", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 4, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24008);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, 0.0, 0.0, 8, 0.0, "2020/04/30 12:00:00", "このままじゃ\nまっひ～に\n叱られちゃうよ", 4, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24009);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, 0.0, 0.0, 9, 0.0, "2020/04/30 12:00:00", "まじめに\nやったんだけどな…\n悔しいな～", 4, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24010);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, 0.0, 0.0, 10, 0.0, "2020/04/30 12:00:00", "やられた…\nねずみって意外と\nてごわいね", 4, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24011);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, 0.0, 0.0, 11, 0.0, "2020/04/30 12:00:00", "おのれ～\nあたしのチーズを\n盗みやがって～！", 4, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24012);
INSERT INTO `v1_e6a11017098b88a9fc4b051620af4eb3380c307597944070ea9a22984aaf2061` VALUES (4, 0.0, 0.0, 12, 1.81, "2020/04/30 12:00:00", "疲れた…\nけど、次こそは\n守り抜くよ…", 1, 24, 10040, "リン", "2030/12/17 14:59:59", 102601, 24013);
